import { TSidebarProps } from "@props/TSidebarProps";
import React from "react";
import { BEM } from "../libs/BEM";
import { ScrollbarComponent, SidebarComponent } from "@codeunic/library-ui/build";
// @ts-ignore
import { Link } from "@routes";
import { connect } from "react-redux";

export const Sidebar = (props: TSidebarProps) => {
    const bm = new BEM("Sidebar", {
        "open": props.open,
    });
    bm.Append(props.className);

    return (
        <SidebarComponent style={props.style} className={bm.toString()}>
            <ScrollbarComponent>
                <section>
                    <h5 font-size="xl" className="sc-fzpjYC fWisVP sc-fzoiQi ozSmQ admin-bro_Header admin-bro_H5"
                        font-weight="normal">
                        <Link route={"/"}>
                            <a>
                                <img src="/admin/frontend/assets/logo-mini.svg"
                                     alt="AdminBro demo page" height="35px"/>
                                <span>AdminBro demo page</span>
                            </a>
                        </Link>
                    </h5>
                </section>
            </ScrollbarComponent>
        </SidebarComponent>
    )
}

export default connect(({global}: any) => ({
    open: global.sidebar,
}))(Sidebar);
